import back from "@/components/Botton/back.vue";
import { apiGetMemLogTypes, apiGetMemFundLogs } from "@/api/Club.js";
export default {
  components: {
    back: back
  },
  data: function data() {
    return {
      filter: false,
      typeId: "0",
      indexNum: 1,
      totalPages: "",
      count: 5,
      cashFlowLog: [],
      cashFlowCategory: [],
      busy: false,
      immediate: false,
      loading: false,
      noData: false
    };
  },
  created: function created() {
    this.getMemLogTypes();
    this.getMemFundLogs();
  },
  methods: {
    // 獲取類別列表
    getMemLogTypes: function getMemLogTypes() {
      var _this = this;

      var data = {
        rptId: 0
      };
      apiGetMemLogTypes(data, true).then(function (res) {
        if (res.Code == "600" || res.data.length == 0) {
          _this.loading = false;
          _this.noData = true;
          return;
        }

        _this.cashFlowCategory = res.data;
      });
    },
    // 獲取金流列表
    getMemFundLogs: function getMemFundLogs() {
      var _this2 = this;

      this.loading = true;
      this.noData = false;
      var data = {
        typeId: this.typeId,
        index: this.indexNum,
        count: 10
      };
      apiGetMemFundLogs(data, true).then(function (res) {
        if (res.Code == "600" || res.data.Data.length == 0) {
          _this2.loading = false;
          _this2.noData = true;
          return;
        }

        _this2.loading = false;
        _this2.noData = false;
        _this2.cashFlowLog = res.data.Data;
        _this2.totalPages = res.data.TatolPages;
      });
    },
    // 點選類別
    clickType: function clickType(typeId) {
      this.cashFlowLog = [];
      this.indexNum = 1;
      this.typeId = typeId;
      this.getMemFundLogs();
      this.filter = false;
    },
    // 無限加載
    load: function load() {
      var _this3 = this;

      console.log(this.totalPages);

      if (this.indexNum >= this.totalPages) {
        return;
      }

      this.busy = true;
      this.indexNum++;
      var data = {
        typeId: this.typeId,
        index: this.indexNum,
        count: 10
      };
      this.loading = true;
      apiGetMemFundLogs(data, true).then(function (res) {
        if (res.Code == "600" || res.data.Data.length == 0) {
          _this3.loading = false;
          _this3.busy = true;
          return;
        } else {
          res.data.Data.forEach(function (el) {
            _this3.cashFlowLog.push(el);

            _this3.busy = false;
          });
          _this3.loading = false;
          _this3.noData = false;
        }
      });
    }
  }
};
